import React, { useState, useEffect } from "react";
import { movieApi } from "../movieApi.js";

const Movie = () => {
  const [movies, setMovies] = useState([]);

  const fetchMovies = async () => {
    const response = await fetch(movieApi); // movieApi는 API 엔드포인트일 것으로 추정됨
    const data = await response.json();
    setMovies(data.results); // API 응답 데이터에서 실제 영화 목록이 포함된 부분을 설정
  };

  useEffect(() => {
    fetchMovies();
  }, []);

  console.log(movies.results);

  return (
    <div>
      {movies.map((movie) => (
        <div key={movie.id}>
          <h2>{movie.title}</h2>
          <p>{movie.overview}</p>
        </div>
      ))}
    </div>
  );
};

export default Movie;
